import React from 'react';
import { Link } from 'react-router-dom';

const UserPosts = () => {
    return (
        <div className="w-full">
            <Link href="#" class=" w-full flex flex-col items-center bg-white border border-gray-200 rounded-lg shadow md:flex-row md:max-w-xl hover:bg-gray-100 dark:border-gray-700 dark:bg-gray-800 dark:hover:bg-gray-700">
                <div className="grid gird-cols-10">
                    <div className="col-span-3">
                        <div className="items-center p-10">
                            <img src="" alt="" />
                        </div>
                    </div>
                    <div className="col-span-7"></div>
                </div>
            </Link>
        </div>

    );
};

export default UserPosts;
